def ff(input_dim,output_dim,depth,width):
 
  model = keras.Sequential()
  inputs = keras.Input(shape=(input_dim,))
  initializer = tf.keras.initializers.RandomUniform(minval=-1., maxval=1.)
  model.add(tf.keras.layers.Dense(input_dim, activation='tanh',name="layer1",kernel_initializer=initializer,bias_initializer=tf.keras.initializers.Zeros()))
  #model.add(tf.keras.layers.Dense(width, input_dim=1, activation='tanh',name="layer1"))
  i = 0
  for i in range(0, depth):
 
   if i<depth-1:
    model.add(Dense(width, activation='tanh',kernel_initializer=initializer,bias_initializer=tf.keras.initializers.Zeros()))
   else:
    model.add(Dense(output_dim, activation='tanh',kernel_initializer=initializer,bias_initializer=initializer))
  # For input:
  x = tf.ones((1, 1))
  y = model(x)
  model.summary()
  # model compiling
  model.compile(loss='binary_crossentropy', optimizer='adam', metrics=['accuracy'])
  # model.evaluate(x,y)
  weights = model.layers[0].get_weights()[0:]
  bias = model.layers[0].get_weights()[1:]
  return model,weights,bias
   
